Naughty Bookworms - Tiff Bannister
Added: November 17, 2014

Tiff is looking to get the teacher's aid position for Mr. Lockwood's class. After going over her credentials, it seems she isn't suited for the position as she would like to think and Mr. Lockwood has to turn her down. Tiff believes her resume shouldn't be the only available resource for the interview process, as she is knowledgeable in others that can't fit on a piece of paper
